import styled from "styled-components";

export const StyledPagination = styled.div`
  background-color:  rgb(201, 17, 17);
  width:100%;
  height: 40px;
  display: flex;
  justify-content: center;
  align-items: center;
  border-bottom:6px solid #f02121;
  position: sticky;
  top: 96px;
  z-index:1;
`;
